import React from 'react';
const Square = (props) => {
    return (
        <div
        onClick={props.onClick} //when ever 
        style ={{
                border:"1px solid", 
                height:"100px",
                width:"100px", 
                display:"flex", 
                justifyContent:"center", 
                alignItems:"center", 
                fontSize:"20px", 
                cursor:"pointer"
            }}
        className='square'>
            <h5>{props.value}</h5>

        </div>

    );
}
export default Square;
